import React  from 'react';

const Pirate = (props) => {

  if(!props.pirate){
    return "Loading..."
  }

  return (
    <>
    <p>{props.pirate.firstName} {props.pirate.lastName}</p>
    <p>{props.pirate.age}</p>
    <p>{props.pirate.ship.name}</p>
    </>
  )
}

export default Pirate;
